import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Slots() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const res = await axios.get('http://localhost:5000/api/slots');
        setData(res.data);
        setLoading(false);
      } catch (err) {
        setError('Failed to fetch slots details');
        setLoading(false);
      }
    };
    fetchData();
  }, []);

  if (loading) return <div className="text-center mt-8 text-gray-600 text-lg">Loading...</div>;
  if (error) return <div className="text-center mt-8 text-red-500 text-lg">{error}</div>;

  return (
    <div className="min-h-screen bg-gray-50 flex flex-col items-center p-6">
      <h2 className="text-3xl font-bold mb-6 text-gray-800">Slots Details</h2>
      <div className="w-full max-w-2xl bg-white rounded-lg shadow-lg overflow-hidden">
        <table className="w-full table-auto">
          <thead>
            <tr className="bg-blue-600 text-white">
              <th className="px-6 py-3 text-left text-sm font-semibold">Slot ID</th>
              <th className="px-6 py-3 text-left text-sm font-semibold">Status</th>
            </tr>
          </thead>
          <tbody>
            {data.map((slot) => (
              <tr
                key={slot._id}
                className="border-b border-gray-200 hover:bg-gray-100 transition-colors"
              >
                <td className="px-6 py-4 text-gray-700">{slot.slot_id}</td>
                <td className="px-6 py-4">
                  <span
                    className={`inline-block px-3 py-1 rounded-full text-sm font-medium ${
                      slot.status === 'empty'
                        ? 'bg-green-100 text-green-800'
                        : 'bg-red-100 text-red-800'
                    }`}
                  >
                    {slot.status.charAt(0).toUpperCase() + slot.status.slice(1)}
                  </span>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Slots;
